import React from 'react';
import UsersTable from '../components/UsersTable';
import '../assets/css/people.css';

function Home() {
    const users = [
        {photo: 1, name: 'John Doe', email: 'john@example.com'},
        {photo: 2, name: 'Jane Smith', email: 'jane@example.com'},
        {photo: 3, name: 'Mike Johnson', email: 'mike@example.com'},
    ];

    return (
        <div className={'content'}>
            <div className={'flex'}>
                <div className={'white_box'}>
                    <div className={'flex'}>
                        <UsersTable users={users}/>
                    </div>
                </div>
                <div className={'white_box'}>
                </div>
            </div>
        </div>
    );
}

export default Home;
